import React, { useState } from 'react';
import { Form, Input, Button, message, Row, Col} from 'antd';
import axios from 'axios';

const GastosDelSiniestro = () => {


    const [loading, setLoading] = useState(false);
    const nombres = localStorage.getItem('nombre');
    const token = localStorage.getItem('token');

    const onFinish = async (values) => {
        console.log("token que se tiene: " + token);
        setLoading(true);
        try {
            values.AjustadorQueRegistra = nombres;

            const jsonData = JSON.stringify(values); // Serializar los datos como JSON
            console.log("Datos a enviar" + jsonData)
            await axios.post('http://localhost:8000/Siniestros/RegistrarSiniestro', jsonData, {
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': token,
                }
            });
            message.success('Siniestro registrado correctamente');
        } catch (error) {
            message.error('Error al registrar el siniestro');
        }
        setLoading(false);
    };

    return (
        // <div style={{ backgroundColor: '#4174E0', padding: '20px', borderRadius: '8px' }}>
        <div style={{ backgroundColor: '#34C0D9', padding: '20px', borderRadius: '8px', textAlign: 'center' }}>

                <h1 className="title">Gastos del siniestro</h1>


            <div style={{ textAlign: 'center', display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100%', marginTop: '2rem', marginBottom: '2rem'}}>
                <img src="https://cdn-icons-png.flaticon.com/512/8733/8733406.png" style={{maxHeight: '100px'}} alt="Gstos.jpg"></img>
            </div>
            <div className="circle-background" style={{ position: 'absolute', marginTop: '-90px', marginLeft: '-25px' }}></div>
            <div style={{backgroundColor: '#5995E1', borderRadius: '20px', padding: '1rem', boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)' }}>
            <Form
                layout="vertical"
                onFinish={onFinish}
            >
                <Row gutter={16}>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="ConceptoDeGasto"
                            label="Concepto del gasto"
                            rules={[{ required: true, message: 'Por favor ingresa el concepto del gasto realizado' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Monto"
                            label="Monto"
                            rules={[{ required: true, message: 'Por favor ingresa el monto del gasto' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={16}>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Comentarios"
                            label="Comentarios / Descripci√≥n del gasto"
                            rules={[{ required: true, message: 'Por favor ingrese una breve descripci√≥n' }]}
                        >
                            <Input />                        
                        </Form.Item>
                    </Col>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Gasto_Adicional"
                            label="Gasto adicional"
                            rules={[{ required: true, message: 'Por favor ingrese el gasto adicional que se requirio' }]}
                        >
                            <Input /> 
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={16}>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="MontoGastoAdicional"
                            label="Monto del gasto adicional"
                            rules={[{ required: true, message: 'Por favor ingresa el monto del gasto adicional' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="ComentarioGastoAdicional"
                            label="Comentarios / descripci√≥n del gastoAdicional"
                            rules={[{ required: true, message: 'Por favor ingresa la serie VIN' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={16}>
                    <Col xs={24}>
                        <Form.Item>
                            <Button type="primary" htmlType="submit" loading={loading} style={{width: '100%', boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.1)' }}>
                                Registrar Siniestro
                            </Button>
                        </Form.Item>
                    </Col>
                </Row>
            </Form>
            
            </div>
            <br></br>
            <br></br>
            <br></br>
        </div>
    );
};

export default GastosDelSiniestro;
